window.bookSummaryJSON = "<p>The dark \"doomed soldier\" Max, formerly Baron Maximilian Valevsky, has committed an act of heroism. The emperor wants to personally reward him, and a meeting with the leader of the empire means only one thing: Max will regain his former name. But the mysterious forces circling the throne of the Zarask Empire have their own opinions about how best to utilize Max and his abilities. Their task is simple: bend our hero to their will and force him to do their bidding. But will Max agree to dance like a marionette with someone else pulling the strings?</p>"; 
